int A,B,cnt,flag,f[10];

void dg(int x,int sum,int target)
{
	if (flag) return;
	if (x>cnt)
	{
		if (sum==target)
		{
			flag=1;
		}
		return;
	}
	dg(x+1,sum,target);
	if (sum+f[x]<=target) dg(x+1,sum+f[x],target);
}

int check(int x)
{
	int sum=0;
	cnt=0;
	while (x)
	{
		cnt++;
		f[cnt]=x%10;
		sum+=x%10;
		x/=10;
	}
	if (sum%2) return 0;
	flag=0;
	dg(1,0,sum/2);
	return flag;
}

int get(int x)
{
	int ans=biao[x/1000000];
	for (int i=(x/1000000)*1000000+1;i<=x;i++)
	{
		if (check(i)) ans++;
	}
	return ans;
}

